import React from 'react';
import { useDispatch, useSelector, connect } from 'react-redux';
import { useState, useEffect } from 'react';
import { addActivity, addDog, getAllDogs, getAllTemperaments } from '../../redux/actions';
import style from '../form/form.module.css';
import { Link } from 'react-router-dom';

const Form = () => {
  const dogs = useSelector((state) => state.allDogs);
  const temperaments = useSelector((state) => state.allTemperaments);

  const max_height = Math.max(dogs.height)
  console.log(max_height)

  const [form, setForm] = useState({
    name: '',
    image: '',
    height: '',
    weight: '',
    life_span: '',
    temperaments:''
  });


  const handleChange = (event) => {
    const property = event.target.name;
    const value = event.target.value;

    setForm({
      ...form,
      [property]: value,
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    dispatch(addDog(form));
    alert('Dog creada');
  };
  const handleSelectDificult = (e) => {
    setForm({
      ...form,
      dificult: e.target.value,
    });
  };

  const handleSelectDuration = (e) => {
    setForm({
      ...form,
      duration: e.target.value,
    });
  };

  const handleSelectUbication = (e) => {
    setForm({
      ...form,
      temperaments: form.temperaments.concat(e.target.value),
    });
  };

  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getAllDogs());
    dispatch(getAllTemperaments());
  }, []);

  return (
    <div className={style.div}>
      <form className={style.form} onSubmit={handleSubmit}>
        <Link to="/dogs" className={style.btn_home}>
          <button>Home</button>
        </Link>
        <div className={style.container}>
          <h2>Add Dog Form</h2>
          <label>
            Name:
            <input
              type="text"
              name="name"
              value={form.name}
              onChange={handleChange}
            ></input>
          </label>

          <label>
            Height:
            <select onChange={handleSelectDificult}>
              <option value={form.height}>Select</option>
              {dogs.height.map((e) => (
                <option value={e} name="dificult">
                  {e}
                </option>
              ))}
            </select>
          </label>

          <label>
            Duration:
            <select onChange={handleSelectDuration}>
              <option value={form.duration}>Select</option>
              {temperaments.map((e) => (
                <option value={e} name="duration">
                  {e}
                </option>
              ))}
            </select>
          </label>

          <label>
            Station:
            <input
              type="text"
              name="station"
              value={form.station}
              onChange={handleChange}
              placeholder="Autumn, Winter, Spring, Summer "
            />
          </label>

          <label>
            Ubication:
            <select
              className="select"
              name="ubication"
              onChange={handleSelectUbication}
              value={form.id}
            >
              <option>Countries</option>
              {dogs?.map((e) => (
                <option key={e.name} value={e.name}>
                  {e.name}
                </option>
              ))}
            </select>
          </label>
          <div className={style.btn}>
            <button type="submit">Add Activity</button>
          </div>
        </div>
      </form>
    </div>
  );
};

const dispatchAct = (dispatch) => {
  return {
    addDog: (payload) => dispatch(addDog(payload)),
  };
};

//const filterCountries = countries.filter((e) => e.name === [activities].ubication)
//? filterCountries.activities.push([activities])
// : new Error ('el pais no existe')

export default connect(null, dispatchAct)(Form);











